import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Update imports
import Loginpage from './components/Login';
import PatientList from './components/PatientList';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>  {/* Use Routes instead of Switch */}
          {/* Define the route for the login page */}
          <Route path="/" element={<Loginpage />} /> {/* Update Route syntax */}
          
          {/* Define the route for the patient list page */}
          <Route path="/patients" element={<PatientList />} /> {/* Update Route syntax */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
